    [],nt"revision_timestamp": "2016-07-27T22:55:57.824452",nt"name": "benton-lake-national-wildlife-refuge-annual-narrative-report-calendar-year-1991",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Benton
    Lake National Wildlife Refuge outlines Refuge accomplishments during the 1991 calendar
    year.  The report begins with a summary of the year's highlights, weather conditions,
    and land acquisition. The report includes a planning section which discusses compliance
    with environmental and cultural resource mandates and research and investigations.
    Refuge administration is outlined; information about personnel, youth programs,
    volunteer programs, funding, and safety is given. Habitat management is also covered;
    subjects include wetlands, grasslands, haying, fire management, and pest control.
    The wildlife section of the report discusses wildlife diversity, endangered and
    threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
    other migratory birds, game mammals, other resident wildlife, animal control, marking
    and banding, and disease prevention and control. The public uses of the Refuge described
    in this report include outdoor classrooms, interpretive programs, hunting, wildlife
    observation, and law enforcement. The equipment and facilities section of the report
    provides information about new construction, rehabilitation, major maintenance,
    equipment utilization and replacement, communication systems, and computer systems.
    Cooperative programs and items of interest are provided at the end. Photographs
    and brochures are attached. A narrative for Benton Lake Wetland Management District
    is included.",nt"license_title": "License Not Specified",nt"extras":
